export default {
  name: 'DesktopView',
  methods: {
    navigateTo(routeName) {
      this.$router.push({
        name: routeName
      });
    },
    navigateToModelParams(modelId) {
      this.$router.push({
        name: 'ModelParams',
        params: {
          modelId: modelId.toString()
        }
      });
    }
  }
};
